import React from 'react';
import './App.css';
import Particles from 'react-particles-js';

const particleParams = {
  particles: {
    number: {
      value: 150,
      density: {
        enable: true,
        value_area: 800
      }
    }
  }
}

function App() {
  return (
    <div>
      <h1>Hello, world!</h1>
      <Particles 
        params = {particleParams}
      />
    </div>
  );
}

export default App;
